 ReactDOM.render(
 	<Navbar />,
	document.getElementById("root")
 );

 ReactDOM.render(
 	<AwsomeSite />,
	document.getElementById("roott")
);

ReactDOM.render(
	<ReactWebSite />,
	document.getElementById('reac')
